def is_queue_full(graph, node_id):
    queue_of_node = graph.nodes[node_id]['alloted_queue'][node_id]
    return queue_of_node.full()

def is_queue_empty(graph, node_id):
    queue_of_node = graph.nodes[node_id]['alloted_queue'][node_id]
    return queue_of_node.empty()

